import React from 'react';

import { NavLink } from 'react-router-dom';

const navigationItem=( props )=>{
  return(
    <NavLink
      to={props.link}
      exact={props.exact}
      activeClassName='active'
    >
    {props.children}
    </NavLink>

  );
};

export default navigationItem;
